import React from "react";

const BOOLEAN = { true: "true", false: "false" };
const PAGES = { homepage: "homepage", notebook: "notebook" };

function NewItemPopup({ createNewNotebook }) {
  return (
    <div className="new-item-popup">
      <div
        className="popup-row"
        onClick={createNewNotebook}
      >
        <p>Notebook</p>
      </div>
      <div
        className="popup-row"
      >
        <p>Dataset</p>
      </div>
      <div
        className="popup-row"
      >
        <p>Chart</p>
      </div>
    </div>
  );
}

export default NewItemPopup;
